import './Modal.css';

// Images pad
const ico = require.context('../../../assets/ico/',true);

const Modal = () => {
    return(
        <>
            <overlay>
                <div>
                    <img />
                    <h1></h1>
                    <img src={ico('./closed.png')} alt="ico closed"/>
                </div>


            </overlay>
        </>
    );
}

export {Modal};
